  "Sanction Details" : "AS PART OF THE CONSENT ORDER MR. MILLS WAS REQUIRED TO TAKE AND PASS CERTAIN EXAMINATIONS WITHIN 90 DAYS.  IN ACCORDANCE WITH THIS REQUIREMENT, MR. MILLS PASSED THE SERIES 7 ON 6/14/1993 AND THE SERIES 63 ON 9/9/1993.  HIGHLAND ASSOCIATES AGREED TO PAY AN ADMINISTRATIVE ASSESSMENT IN THE TOTAL AMOUNT OF $34,257.72, WHICH IT PAID ON OR ABOUT 2/24/1993.",
  "Broker Comment" : "THE FACTS GIVING RISE TO THIS CONSENT ORDER INVOLVED A BELIEF AND CLAIM BY HIGHLAND ASSOCIATES, INC., BASED UPON ITS UNDERSTANDING OF CERTAIN PROVISIONS OF THE ACT, THAT IT WAS EXEMPT FROM THE INVESTMENT ADVISOR REGISTRATION REQUIREMENTS UNDER THE ACT. AFTER, HAVING BEEN RREGISTERED AS AN INVESTMENT ADVISOR WITH THE ASC FOR 1991, HIGHLAND ASSOCIATES,INC. DID NOT RENEW ITS INVESTMENTS ADVISOR REGISTRATION FOR 1992 BASED UPON ITS UNDERSTANDING OF CERTAIN EXEMPTIONS IN THE ACT. DURING THIS PERIOD, HIGHLAND ASSOCIATES, INC. WAS REGISTERED AS AN INVESTMENT ADVISOR WITH THE SECURITIES AND EXCHANGE COMMISSION. FOLLOWING AN ON-SITE REVIEW OF HIGHLAND ASSOCIATES, INC. THE ASC CONCLUDED THAT HIGHLAND ASSOCIATES,INC. WAS NOT IN FACT EXEMPT FROM THE REGISTRATION REQUIREMENT OF THE ACT AND THAT HIGHLAND ASSOCIATES, INC. SHOULD HAVE BEEN REGISTERED."
